import logo from './logo.svg';
import './App.css';
import Homepage from './component/homepage';
import Recipe from './component/recipe';
export const config = {
  endpoint: `http://localhost:8082/v1`,
};
function App() {
  return (
    <div className="App">
       <Switch>
       <Route exact path="/">
          <Homepage />
        </Route>
        <Route exact path="/recipe/:recipeId">
          <Recipe />
        </Route>
       </Switch>

    </div>
  );
}

export default App;
